import React from 'react';
import ReactDOM from 'react-dom';

const name="Rahul Maheshwari"
ReactDOM.render(
  // <div><h1>Hello World</h1> 
  // <p>I am Rahul</p></div>,  // only one element islie div me wrap kia h and we can also wrap in [] each element separated by comma,
  <React.Fragment> 
    <h1>Hello World {2+3}</h1> 
    <h3>{`My name is ${name}`}</h3>
  <p>I am {name}</p>
  </React.Fragment>, // no need of extra div and less memory is consumed and we can also use <> </>
  document.getElementById("root"))
// JSX:JS extension or JS XMl 
//To use JS things ,take {}
// in render HTML elements are called as JSX  elements in React
